}) => {
  const [marriedId, setMarriedId] = useState();
  const [country, setContry] = useState([]);
  const [proofOfIdentityType, setProofOfIdentityType] = useState([]);
  const [
    isCompanyMarriedTaxEditModalOpen,
    setIsCompanyMarriedTaxEditModalOpen,
  ] = useState(false);
  function handleCompanyMarriedTaxEditCloseModal() {
    setIsCompanyMarriedTaxEditModalOpen(false);
  }
  function handleCompanyMarriedTaxEditOpenModal() {
    setIsCompanyMarriedTaxEditModalOpen(true);
  }
  function handleCompanyMarriedTaxEditCloseModal() {
    setIsCompanyMarriedTaxEditModalOpen(false);
  }
  const [taxInformationId, setTaxInformationId] = useState();
  const [editMarriedTax, setEditMarriedTax] = useState({
    Id: taxInformationId,
    FirstName: "",
    MiddleName: "",
    LastName: "",
    NationalityID: "",
    CountryOfOriginID: "",
    CountryOfResidenceID: "",
    ProofOfIdentityTypeID: "",
    ProofOfIdentity: "",
    MarriageDate: "",
    MarriageCertificate: "",

    MarriageCertificateIssuer: "",
    ProofOfIdentityIssueDate: "",
    ProofOfIdentityExpirDate: "",
  });
  const handleInputChangeEditMarriedTax = (event) => {
    const { name, value } = event.target;
    setEditMarriedTax({ ...editMarriedTax, [name]: value });
  };
  const updateMarriedTaxById = (taxInformationId) => {
    CommonServices.getMarriedTax(taxInformationId)
      .then((res) => {
        setEditMarriedTax({
          ...editMarriedTax,
          Id: taxInformationId,
          FirstName: res.data.Result.FirstName,
          MiddleName: res.data.Result.MiddleName,
          LastName: res.data.Result.LastName,
          NationalityID: res.data.Result.NationalityID,
          CountryOfOriginID: res.data.Result.CountryOfOriginID,
          CountryOfResidenceID: res.data.Result.CountryOfResidenceID,
          ProofOfIdentityTypeID: res.data.Result.ProofOfIdentityTypeID,
          ProofOfIdentity: res.data.Result.ProofOfIdentity,
          MarriageDate: res.data.Result.MarriageDate,
          MarriageCertificate: res.data.Result.MarriageCertificate,
          MarriageCertificateIssuer: res.data.Result.MarriageCertificateIssuer,
          ProofOfIdentityIssueDate: res.data.Result.ProofOfIdentityIssueDate,
          ProofOfIdentityExpirDate: res.data.Result.ProofOfIdentityExpirDate,
        });
      })
      .catch((err) => console.log(err));
  };
  useEffect(() => {
    updateMarriedTaxById();
  }, []);
  const updateMarriedTax = () => {
    CommonServices.updateMarriedTax(taxInformationId, editMarriedTax)
      .then((response) => {})
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    updateMarriedTax();
  }, []);
  const fetchContry = () => {
    CommonServices.getCountry()
      .then((response) => {
        setContry(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchContry();
  }, []);

  const fetchProofOfIdentityType = () => {
    CommonServices.getProofOfIdentityTypes()
      .then((response) => {
        setProofOfIdentityType(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchProofOfIdentityType();
  }, []);
  return (
    <div>
      <CompanyModal
        isOpen={isCompanyMartailStatusModalOpen}
        onClose={handleCompanyMartailStatusCloseModal}
        title="Add marital status information"
      >
        <div className="rounded-lg overflow-hidden">
          {holdMarriedTax ? (
            <table className="table table-bordered table-striped bg-purple-100">
              <thead>
                <th className="px-2 py-4"> Name</th>
                <th className="px-2 py-4"> Nationality</th>
                <th className="px-2 py-4"> Country Of Origin</th>
                <th className="px-2 py-4"> Country Of Residence</th>
                <th className="px-2 py-4"> Proof Of Identity Type</th>
                <th className="px-2 py-4"> Proof Of Identity</th>
                <th className="px-2 py-4"> Marriage Date</th>
                <th className="px-2 py-4"> Marriage Certificate Issuer</th>
                <th className="px-2 py-4"> Proof Of Identity Issue Date</th>
                <th className="px-2 py-4"> Proof Of Identity Expir Date</th>
                <th className="px-2 py-4"> Action </th>
              </thead>
              <tbody>
                <tr>
                  <td>
                    {holdMarriedTax.FirstName} {holdMarriedTax.MiddleName}{" "}
                    {holdMarriedTax.LastName}
                  </td>

                  <td>{holdMarriedTax.Nationality}</td>
                  <td>{holdMarriedTax.CountryOfOrigin}</td>
                  <td>{holdMarriedTax.CountryOfResidence}</td>
                  <td>{holdMarriedTax.ProofOfIdentityType}</td>
                  <td>{holdMarriedTax.ProofOfIdentity}</td>
                  <td>{holdMarriedTax.MarriageDate}</td>
                  <td>{holdMarriedTax.MarriageCertificateIssuer}</td>
                  <td>{holdMarriedTax.ProofOfIdentityIssueDate}</td>
                  <td>{holdMarriedTax.ProofOfIdentityExpirDate}</td>
                  <td>{holdMarriedTax.TaxClearanceID}</td>
                  <td>
                    <button
                      onClick={() => {
                        handleCompanyMarriedEditOpenModal();
                        updateMarriedById(holdMarriedTax.Id);
                        setTaxInformationId(holdMarriedTax.Id);
                        // saveTaxSoleInfo(sole.Id);
                      }}
                      className="text-purple-600 rounded-md font-semibold "
                    >
                      Edit
                    </button>
                  </td>
                  <td>
                    <button
                      type="submit"
                      onClick={() => {}}
                      className="text-purple-600 rounded-md font-semibold "
                    >
                      Marital status detail
                    </button>
                  </td>
                  <td>
                    <button className="text-purple-600 rounded-md font-semibold ">
                      Tax detail
                    </button>
                  </td>
                </tr>
              </tbody>
            </table>
          ) : (
            ""
          )}
        </div>
        <div>
          {holdMarried <= 0 && (
            <AddMaritalStatus Add marital status information SoleId={SoleId} />
          )}
        </div>
      </CompanyModal>
      <CompanyModal
        isOpen={isCompanyMarriedTaxEditModalOpen}
        onClose={handleCompanyMarriedTaxEditCloseModal}
        title="tax edit information"
      >
        <div>
          <form onSubmit={updateMarriedTax}>
            <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
              <LoanTextField
                id="FirstName"
                label="FirstName"
                value={editMarriedTax.FirstName}
                onChange={handleInputChangeEditMarriedTax}
                name="FirstName"
              />
              <LoanTextField
                id="MiddleName"
                label="MiddleName"
                value={editMarriedTax.MiddleName}
                onChange={handleInputChangeEditMarriedTax}
                name="MiddleName"
              />
              <LoanTextField
                id="LastName"
                label="LastName"
                value={editMarriedTax.LastName}
                onChange={handleInputChangeEditMarriedTax}
                name="LastName"
              />
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Nationality{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editMarriedInfo.NationalityID = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Country Of Origin{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editMarriedInfo.CountryOfOriginID = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Country Of Residence{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editMarriedInfo.CountryOfResidenceID = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Proof Of Identity Type{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editMarriedInfo.ProofOfIdentityTypeID = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {proofOfIdentityType.map((yourProofOfIdentityType) => (
                    <MenuItem
                      key={yourProofOfIdentityType.Id}
                      ProofOfIdentityTypeID={yourProofOfIdentityType.Id}
                      value={yourProofOfIdentityType.Id}
                    >
                      {yourProofOfIdentityType.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <LoanTextField
                id="ProofOfIdentity"
                label="ProofOfIdentity"
                value={editMarriedTax.ProofOfIdentity}
                onChange={handleInputChangeEditMarriedTax}
                name="ProofOfIdentity"
              />
              <LoanTextField
                id="MarriageDate"
                label="MarriageDate"
                value={editMarriedTax.MarriageDate}
                onChange={handleInputChangeEditMarriedTax}
                name="MarriageDate"
              />
              <LoanTextField
                id="MarriageCertificate"
                label="MarriageCertificate"
                value={editMarriedTax.MarriageCertificate}
                onChange={handleInputChangeEditMarriedTax}
                name="MarriageCertificate"
              />
              <LoanTextField
                id="MarriageCertificateIssuer"
                label="MarriageCertificateIssuer"
                value={editMarriedTax.MarriageCertificateIssuer}
                onChange={handleInputChangeEditMarriedTax}
                name="MarriageCertificateIssuer"
              />
              <LoanTextField
                id="ProofOfIdentityIssueDate"
                label="ProofOfIdentityIssueDate"
                value={editMarriedTax.ProofOfIdentityIssueDate}
                onChange={handleInputChangeEditMarriedTax}
                name="ProofOfIdentityIssueDate"
              />
              <LoanTextField
                id="ProofOfIdentityExpirDate"
                label="ProofOfIdentityExpirDate"
                value={editMarriedTax.ProofOfIdentityExpirDate}
                onChange={handleInputChangeEditMarriedTax}
                name="ProofOfIdentityExpirDate"
              />
            </div>
            <div>
              <button className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline">
                Update
              </button>
            </div>
          </form>
        </div>
      </CompanyModal>
    </div>
  );
};
export default ViewMaritalStatus;
